import React, { useState } from 'react';

const MarksAdd = () => {
  const [selectedOption, setSelectedOption] = useState('');
  const [marks, setMarks] = useState('');

  const handleSelectChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const handleMarksChange = (event) => {
    setMarks(event.target.value);
  };

  const handleCancel = () => {
    // Handle cancel logic
  };

  const handleSubmit = () => {
    // Handle submit logic
  };

  return (
    <div>
      <h3>Year: {selectedOption}</h3>
      <select value={selectedOption} onChange={handleSelectChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Course: {selectedOption}</h3>
      <select value={selectedOption} onChange={handleSelectChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Batch: {selectedOption}</h3>
      <select value={selectedOption} onChange={handleSelectChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Stu ID:</h3>
      <input type="text" value={selectedOption} onChange={handleSelectChange} />
      <h3>Sub Name:</h3>
      <input type="text" value={selectedOption} onChange={handleSelectChange} />
      <h3>Marks:</h3>
      <input type="number" value={marks} onChange={handleMarksChange} /> <br />
      <button onClick={handleCancel}>Cancel</button>
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
};

export default MarksAdd;
